import React from 'react';
import './App.css';
import Head from './../src/components/Head/Head';
import Navbar from './../src/components/Navbar/Navbar';

function App() {
  return (
    <div className="App">
      <Head />
      <div className="Nav">
      <Navbar />
      </div>
    </div>
  );
}

export default App;
